      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      }
    ]
  }
  const result = courses.map(courses => courses.content)
  console.log("result",result)
  return (
  <>
  <Course name={courses.name} />
  {/* <ul>{courses.map(courses => <li key={courses.parts.id}>{courses.parts.name} {courses.parts.exercises}</li>)}</ul> */}
  </>
  )
}

export default App
